import React, { useEffect, useState } from "react";
import { getProjects } from "../api";  // ✅ imported

function Projects() {
  const [projects, setProjects] = useState([]);

  useEffect(() => {
    // Call backend API
    getProjects()
      .then((res) => {
        setProjects(res.data);   // Save data into state
      })
      .catch((err) => console.error(err));
  }, []);

  return (
    <div>
      <h2>Projects</h2>
      <ul>
        {projects.map((p, index) => (
          <li key={index}>
            {p.username} → {p.projectId} → {p.totalAmount}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Projects;
